%[text] ## Problem 2. Passive scalar transport from Reynolds Transport Theorem
%[text] - \[A passive scalar is a scalar quantity that is transported by advection (the transfer of a substance, or matter, by bulk motion of a fluid) and diffusion in a flow but does not influence the velocity field or fluid dynamics.\] \
%[text] #### 1. Time rate of change of dye mass
%[text] ### Fundamentals
%[text] <u>a. Conservation of Mass Principle</u>
%[text] $m\_{in} - m\_{out} = \\Delta\_{CV}$
%[text] *The net mass transfer to or from a control volume during a time interval* $\\Delta t$ *is equal to the net change in the total mass within the control volume during* $\\Delta t$. \[1\]
%[text] #### **General Conservation of Mass**
imshow('element for cons of mass.png') %[output:931ba538]
%[text] $\\frac{d}{dt}\\int\_{\\text{CV}} \\rho \\, dV + \\int\_{\\text{CS}} \\rho \\, (\\vec{V} \\cdot \\vec{n})\\, dA = 0$     (2-1)
%[text] "... *the time rate of change of mass within the control volume plus the net mass flow rate through the control surface is equal to zero."*
%%
%[text] <u>b. Total Dye Mass</u>:
%[text] Since:
%[text] $c = \\frac{M\_{dye}} {M\_{mixture}}$
%[text] then,
%[text] $M\_{dye} = c M\_{mixture} = c \\rho\_{mixture} V$
%[text] Generally:
%[text] $M\_{dye}(t) = \\int\_{V} \\rho(x,t) c(x,t)\\, dV$        (2-2)
%%
%[text] <u>c. Time Rate of Change of Dye Mass</u>:
%[text] The dye is conserved, so expanding on the *general conservation of mass* expression (2-1) above, gives:
%[text] $\\frac{d}{dt} \\int\_{\\text{V}} \\rho c \\, dV + \\oint\_{\\partial V} (\\rho c \\vec{u} + \\mathbf{j}) \\cdot \\vec{n}\\, dA = 0$       (2-3) 
%[text] - The left integral represents the time rate of change of mass within the CV (i.e., change in a CV).
%[text] - The right integral represents the total flux through the boundary surface (i.e., change in a system).
%[text] - Where $(\\rho c \\vec{u}) \\vec{n}$ is the **advective/convective** dye flux and $\\mathbf{j} \\vec{n}$ is the **diffusive dye flux.** \
%%
%[text] #### 2. Reynolds Transport Theorem and Divergence Theorem for the Differential Equation
%[text] <u>d. Reynolds Transport Theorem</u>
%[text] For the fixed CV, RTT reduces to:
%[text] $\\frac{d}{dt} \\int\_{\\text{V}} \\rho c \\, dV = \\int\_{V} \\frac{\\partial (\\rho c)}{\\partial t} dV$
%[text] Since the CV is not moving or deforming with time, the time derivative can be moved inside since it is irrelevant whether we differentiate or integrate first. \[1\] It is expressed as a partial derivative since density and the dye mass ratio are space-dependent (functions of *x* and *t*).
%%
%[text] <u>e. Divergence Theorem on the Surface Flux</u>
%[text] $\\oint\_{\\partial V} \\mathbf{G} \\cdot \\mathbf{n}\\, dA = \\int\_{V} \\nabla \\cdot \\mathbf{G}\\, dV$
%[text] Let:
%[text] $\\mathbf{G} = (\\rho c \\vec{u} + \\mathbf{j})$
%[text] $\\oint\_{\\partial V} (\\rho c \\vec{u} + \\mathbf{j}) \\cdot \\vec{n}\\, dA = \\int\_{V} \\nabla \\cdot (\\rho c \\vec{u} + \\mathbf{j})\\, dV$
%%
%[text] <u>f. Combine Them</u>
%[text] $\\frac{\\partial(\\rho c)} {t} + \\nabla \\cdot (\\rho c \\vec{u} - \\rho D \\nabla c) = 0$         (2-4)
%%
%[text] #### 3. Incompressible Flow and Constant Density and Diffusivity
%[text] Incompressible flow:
%[text] $\\frac{\\partial{\\rho}} {\\partial{t}} = 0$ (density does not change with time)
%[text] and
%[text] $\\nabla \\cdot \\vec{u} = 0$
%[text] Expand $\\nabla \\cdot (c \\vec{u})$
%[text]  $\\nabla \\cdot (c \\vec{u}) = \\vec{u} \\cdot c + c(\\nabla \\cdot \\vec{u}) = \\vec{u} \\cdot c$
%[text] (2-4) becomes:
%[text] $\\frac{\\partial c} {t} + \\vec{u} \\cdot \\nabla c = D \\nabla^2 c$         (2-5)
%[text] - This is the simplified passive-scalar transport equation. \
%%
